(function() {
  $(function() {
    var uploadedFilesCount;
    uploadedFilesCount = 0;
    $('#s3_uploader').S3Uploader({
      remove_completed_progress_bar: false,
      progress_bar_target: $('#uploads_container')
    });
    $('#s3_uploader').on('s3_upload_failed', function(e, content) {
      console.error(e, content);
      return alert(content.filename + ' failed to upload');
    });
    $('#s3_uploader').on('s3_upload_complete', function(e, content) {
      return uploadedFilesCount += 1;
    });
    return $('#s3_uploader').on('s3_uploads_complete', function(e, content) {
      var $alertSelector;
      $('#modal-import-photos').modal('hide');
      $alertSelector = $('#alert-import-photos-success');
      $alertSelector.text(uploadedFilesCount + ' photos ont t importes');
      $alertSelector.show();
      setTimeout((function() {
        $alertSelector.fadeOut('slow');
        return $alertSelector.empty();
      }), 3000);
      return uploadedFilesCount = 0;
    });
  });

}).call(this);
